*************************************************************************************
Morgan reads an article in the newspaper about the severity of bullying in schools and becomes concerned with bullying in Upper Redwood High. Tanya reads out everyone&amp;#039;s horoscopes. Tanya&amp;#039;s says that her past will catch up with her....oooo....In the meantime, Kevin takes up boxing lessons, and Ethan looses his beeper. They find out the beeper is in the cabinet in the anteroom. They try to open the doors, but they seem stuck. Tanya is concerned about Kevin&amp;#039;s new hobby, and tells Ethan that she was once a school bully. Yes, TANYA PANDA, a BULLY. Demonstrating what happened in Grade 3, she swung her fist into the cabinet door, letting the other side fly open and hit Ethan in the head. Tanya, who had her eyes covered, believed she was the one who hit Ethan. The same thing happens to George out in the hallway, where Tanya thought she hit him. Morgan gets suspicious about these bruises on their faces, and makes the conclusion that Kevin is the school bully.
